import React from 'react';

function titles() {
    return (
           <div className="calcurako-item">
               <button>Players</button>
               <button>Corte</button>
               <button>Muerto</button>
               <button>Comodin</button>
               <button>Canasta Pura</button>
               <button>Canasta Impura</button>
               <button>Numero 1</button>
               <button>Numeros 3 al 7</button>
               <button>Numeros 8 al 13</button>
               <button>Subtotal</button>
           </div>
    )
}

export default titles;
